import React from 'react';

import Container from 'react-bootstrap/Container';
import Form from 'react-bootstrap/Form';

import KakaoMap from 'components/KakaoMap';
import GetSitterJobs from 'components/GetSitterJobs/GetSitterJobs';

const FindSitter = () => {
    return (
        <div>
        <span> 시터 찾기 ></span> <span></span>
            <Container>
                    <h1>내 집 주변의 시터 일자리</h1>
                    <p>
                        회원가입과 안심인증을 한 뒤에는 서비스를 무료로 이용 할 수 있습니다.
                        집 주변의 시터 구인 구직 정보를 한꺼번에 볼 수 있습니다.
                        원하는 일자리나 시터에게 메세지를 보내 보세요~
                    </p>
            </Container>
            <Form>
  {['checkbox', 'radio'].map((type) => (
    <div key={`default-${type}`} className="mb-3">
      <Form.Check 
        type={type}
        id={`default-${type}`}
        label={`default ${type}`}
      />

      <Form.Check
        disabled
        type={type}
        label={`disabled ${type}`}
        id={`disabled-default-${type}`}
      />
    </div>
  ))}
</Form> 
        <KakaoMap/> <GetSitterJobs/>
        
        </div>
    );

}

export default FindSitter;
